import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/Header";

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<div style={pageStyle}>Home Page</div>} />
        <Route path="/products" element={<div style={pageStyle}>Products Page</div>} />
        <Route path="/categories" element={<div style={pageStyle}>Categories Page</div>} />
        <Route path="/about" element={<div style={pageStyle}>About Page</div>} />
        <Route path="/contact" element={<div style={pageStyle}>Contact Page</div>} />
        <Route path="/login" element={<div style={pageStyle}>Login Page</div>} />
      </Routes>
    </Router>
  );
};

const pageStyle = {
  padding: "50px",
  textAlign: "center",
  fontSize: "24px",
  fontWeight: "bold",
};

export default App;
